PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE gender_summary (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                created_at TEXT NOT NULL,
                laki_laki TEXT, perempuan TEXT, jk_tidak_terdata TEXT, total TEXT
            );
CREATE TABLE identitas_organisasi (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                kode_organisasi TEXT UNIQUE NOT NULL,
                created_at TEXT NOT NULL,
                no_telp TEXT, email TEXT, sumber_data TEXT, tanggal TEXT, kota_cakupan_cabang TEXT
            , catatan TEXT, hmhi_cabang TEXT, diisi_oleh TEXT, jabatan TEXT);
CREATE TABLE IF NOT EXISTS "kelompok_usia" (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    kode_organisasi TEXT NOT NULL,
                    created_at TEXT NOT NULL,
                    kelompok_usia TEXT,
                    ha_ringan INTEGER, ha_sedang INTEGER, ha_berat INTEGER, hb_ringan INTEGER, hb_sedang INTEGER, hb_berat INTEGER, hemo_tipe_lain INTEGER, vwd_tipe1 INTEGER, vwd_tipe2 INTEGER,
                    FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
                );
CREATE TABLE IF NOT EXISTS "vwd_usia_gender" (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    kode_organisasi TEXT,
                    created_at TEXT NOT NULL,
                    kelompok_usia TEXT, laki_laki INTEGER, perempuan INTEGER, jk_tidak_terdata INTEGER, total INTEGER,
                    FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
                );
CREATE TABLE IF NOT EXISTS "gender_per_kelainan" (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    kode_organisasi TEXT,
                    created_at TEXT NOT NULL,
                    kelainan TEXT, laki_laki INTEGER, perempuan INTEGER, tidak_ada_data_gender INTEGER, total INTEGER, is_total_row TEXT,
                    FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
                );
CREATE TABLE tingkat_hemofilia_jk (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                kode_organisasi TEXT,
                created_at TEXT NOT NULL,
                label TEXT,
                ringan INTEGER,
                sedang INTEGER,
                berat INTEGER,
                tidak_diketahui INTEGER,
                total INTEGER,
                is_total_row TEXT,
                FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
            );
CREATE TABLE anak_hemofilia_berat (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                kode_organisasi TEXT,
                created_at TEXT NOT NULL,
                "kategori" TEXT,
                berat INTEGER,
                is_total_row TEXT,
                FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
            );
CREATE TABLE vwd_berat_jumlah (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                kode_organisasi TEXT,
                created_at TEXT NOT NULL,
                label TEXT,
                jumlah INTEGER,
                jumlah_medis INTEGER,
                is_total_row TEXT,
                FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
            );
CREATE TABLE hemofilia_inhibitor (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                kode_organisasi TEXT,
                created_at TEXT NOT NULL,
                label TEXT,
                terdiagnosis_aktif INTEGER,
                kasus_baru_2025 INTEGER,
                penanganan INTEGER,
                FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
            );
CREATE TABLE pasien_nonfaktor_inhibitor (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                kode_organisasi TEXT,
                created_at TEXT NOT NULL,
                jenis_penanganan TEXT,
                ketersediaan TEXT,
                jumlah_pengguna INTEGER,
                FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
            );
CREATE TABLE pasien_nonfaktor_tanpa_inhibitor (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                kode_organisasi TEXT,
                created_at TEXT NOT NULL,
                jenis_penanganan TEXT,
                ketersediaan TEXT,
                jumlah_pengguna INTEGER,
                FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
            );
CREATE TABLE IF NOT EXISTS "rumah_sakit" (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    "No" INTEGER,
    "Pemilik" TEXT,
    "Kode Yankes" TEXT,
    "Nama" TEXT,
    "Lokasi" TEXT,
    "Propinsi" TEXT
);
CREATE TABLE IF NOT EXISTS "rs_penangan_hemofilia" (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    kode_organisasi TEXT,
                    created_at TEXT NOT NULL,
                    nama_rumah_sakit TEXT,
                    tipe_rs TEXT,
                    dokter_hematologi TEXT,
                    tim_terpadu TEXT,
                    lokasi TEXT,
                    propinsi TEXT,
                    FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
                );
CREATE TABLE ketersediaan_produk_replacement (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                kode_organisasi TEXT,
                created_at TEXT NOT NULL,
                produk TEXT,
                ketersediaan TEXT,
                digunakan TEXT,
                merk TEXT,
                jumlah_pengguna INTEGER,
                jumlah_iu_per_kemasan INTEGER,
                harga REAL,
                FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
            );
CREATE TABLE penanganan_kesehatan (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                kode_organisasi TEXT,
                created_at TEXT NOT NULL,
                jenis_hemofilia TEXT,
                jenis_penanganan TEXT,
                layanan_rawat TEXT,
                dosis_per_orang_per_kedatangan REAL,
                frekuensi TEXT,
                FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
            );
CREATE TABLE hemo_berat_prophylaxis_usia (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                kode_organisasi TEXT,
                created_at TEXT NOT NULL,
                jenis TEXT,
                persen_0_18 REAL,
                persen_gt_18 REAL,
                frekuensi TEXT,
                produk TEXT,
                tidak_ada_data TEXT,
                dosis_per_kedatangan REAL,
                estimasi_data_real TEXT,
                FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
            );
CREATE TABLE perkembangan_pelayanan_penanganan (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                kode_organisasi TEXT,
                created_at TEXT NOT NULL,
                jenis TEXT,
                jumlah_terapi_gen INTEGER,
                tahun INTEGER,
                nama_rumah_sakit TEXT,
                lokasi TEXT,
                propinsi TEXT,
                FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
            );
CREATE TABLE informasi_donasi (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                kode_organisasi TEXT,
                created_at TEXT NOT NULL,
                jenis_donasi TEXT,
                merk TEXT,
                jumlah_total_iu_setahun REAL,
                kegunaan TEXT,
                FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
            );
CREATE TABLE infeksi_transfusi_darah (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                kode_organisasi TEXT,
                created_at TEXT NOT NULL,
                kasus TEXT,
                jml_hepatitis_c INTEGER,
                jml_hiv INTEGER,
                penyakit_menular_lainnya TEXT,
                FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
            );
CREATE TABLE kematian_hemofilia_2024kini (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                kode_organisasi TEXT,
                created_at TEXT NOT NULL,
                penyebab_kematian TEXT,
                perdarahan INTEGER,
                gangguan_hati INTEGER,
                hiv INTEGER,
                penyebab_lain TEXT,
                tahun_kematian INTEGER,
                FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
            );
CREATE TABLE jumlah_individu_hemofilia (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                kode_organisasi TEXT NOT NULL,
                created_at TEXT NOT NULL,
                jumlah_total_ab INTEGER, hemofilia_lain INTEGER, terduga INTEGER, vwd INTEGER, lainnya INTEGER,
                FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
            );
CREATE TABLE anak_hemofilia_berat_new (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    kode_organisasi TEXT,
                    created_at TEXT NOT NULL,
                    label TEXT,
                    berat INTEGER,
                    is_total_row TEXT,
                    FOREIGN KEY (kode_organisasi) REFERENCES identitas_organisasi(kode_organisasi)
                );
CREATE TABLE kelompok_usia_gabung (
            id INTEGER PRIMARY KEY,
            kode_organisasi TEXT NOT NULL,
            created_at TEXT NOT NULL,
            kelompok_usia TEXT,
            hemo_a INTEGER,
            hemo_b INTEGER,
            hemo_tipe_lain INTEGER,
            vwd_tipe1 INTEGER,
            vwd_tipe2 INTEGER
        );
CREATE UNIQUE INDEX idx_identitas_organisasi_provinsi ON identitas_organisasi(kota_cakupan_cabang);
CREATE UNIQUE INDEX idx_identitas_organisasi_hmhi ON identitas_organisasi(hmhi_cabang);
COMMIT;
